        children: [{
                path: "/",
                element: < Home / >
            },
            {
                path: "/Write",
                element: < Write / >
            },
            {
                path: "/Single",
                element: < Single / >
            }
        ]
    },
    {
        path: "/Register",
        element: < Register / > ,
    },
    {
        path: "/Login",
        element: < Login / > ,
    },
    {
        path: "/Write",
        element: < Write / > ,
    },
    {
        path: "/Single",
        element: < Single / > ,
    },
    {
        path: "/Home",
        element: < Home / > ,
    },

]);

function App() {
    return ( <
        div >
        <
        RouterProvider router = { router }
        />    </div >
    );
}

export default App;
